// Deal with browsers that don't allow session or local storage...

try {
  // Initialize sessionStorage key-value pairs//////////
  if (sessionStorage.getItem("fragment") === null) {
    sessionStorage.setItem("fragment", "");
  }
  if (sessionStorage.getItem("language") === null) {
    sessionStorage.setItem("language", "thai");
  }
  //////////////////////////////////////////////////////
}
catch (e) {
  swal({
    title: "Please turn off 'private' for this browser or use Chrome.",
    text: "It will run slowly in 'private.'",
    timer: 15000,
    showConfirmButton: true,
    animation: "slide-from-bottom"
  });
}

function sessionStorageAvailable(key) {
  return sessionStorage.getItem(key) !== null
}
;
// Collapse hamburger menu from document
$(document).on('click', function() {
  collapseNavBar();
});

// If someone presses the esc kep w/in a nested modal, this will ensure that the page is not fixed/frozen for scrolling.
$(document).on("keydown", function(e) {
  if (e.keyCode == 27) {
    location.reload();
  }
});

function collapseNavBar() {
  $(".navbar-collapse").removeClass("in");
}

setTimeout(function(){ 
  $(".alert").fadeOut(2000); 
}, 2200 );


// for 'Approve' & 'Disapprove' buttons on leader dashboard
$(".approved-button").on ("click tap", function(e) {
  e.preventDefault();
  hideButton(this, 0);
  hideButton(this, 1);
  showButton(this, 2);
  showButton(this, 3);
  hideButton(this, 4);
  hideButton(this, 5);
  hideButton(this, 6);
});

$(".disapproved-button").on ("click tap", function(e) {
  e.preventDefault();
  hideButton(this, 0);
  hideButton(this, 1);
  showButton(this, 2);
  showButton(this, 3);
  hideButton(this, 4);
  hideButton(this, 5);
  hideButton(this, 6);
});

$(".approve-admin").on ("click tap", function(e) {
  e.preventDefault();
  showButton(this, 0);
  hideButton(this, 1);
  hideButton(this, 2);
  hideButton(this, 3);
  showButton(this, 4);
  hideButton(this, 5);
  hideButton(this, 6);
});

$(".disapprove-admin").on ("click tap", function(e) {
  e.preventDefault();
  hideButton(this, 0);
  showButton(this, 1);
  hideButton(this, 2);
  hideButton(this, 3);
  hideButton(this, 4);
  hideButton(this, 5);
  hideButton(this, 6);
});

$(".mail-to-admin").on ("click tap", function(e) {
  e.preventDefault();
  hideButton(this, 0);
  hideButton(this, 1);
  hideButton(this, 2);
  hideButton(this, 3);
  hideButton(this, 4);
  showButton(this, 5);
  $($(this).parent().children()[6]).show().fadeOut(10000);
});

function hideButton(element, index) {
  $($(element).parent().children()[index]).hide();
}

function showButton(element, index) {
  $($(element).parent().children()[index]).show();
}


// Maintain scroll position when flag clicked; see nav_bar.hbs, 
$(document).on('scroll', function () {
  var num = $(window).scrollTop();
  sessionStorage.setItem("scrollTopPos", num);
});


// Re-render footer when window size changes
$(window).on('resize', function() {
  App.getFooter();
  $(window).scrollTop(sessionStorage.getItem("scrollTopPos"));
});














